import React, { useState } from 'react';
import axios from 'axios';

function RegisterFarmerForm() {
  const [username, setUsername] = useState('');
  const [password, setPassword] = useState('');
  const [email, setEmail] = useState('');
  const [name, setName] = useState('');
  const [description, setDescription] = useState('');
  const [address, setAddress] = useState('');
  const [city, setCity] = useState('');
  const [zipCode, setZipCode] = useState('');
  const [latitude, setLatitude] = useState('');
  const [longitude, setLongitude] = useState('');
  const [phone, setPhone] = useState('');
  const [website, setWebsite] = useState('');

  const handleSubmit = async (event) => {
    event.preventDefault();

    try {
      // Envoie les données d'inscription à l'API back-end
      const response = await axios.post('/users', { username, password, email });

      // Une fois l'utilisateur créé, crée le profil agriculteur
      const userId = response.data.user.id; // Récupère l'ID de l'utilisateur créé
      await axios.post('/farmers', {
        userId,
        name,
        description,
        address,
        city,
        zipCode,
        latitude: latitude ? parseFloat(latitude) : null,
        longitude: longitude ? parseFloat(longitude) : null,
        phone,
        website
      });

      // Gère la réponse (par exemple, affiche un message de succès, redirige l'utilisateur)
      console.log('Inscription réussie', response.data);
    } catch (error) {
      console.error("Erreur lors de l'inscription: ", error);
    }
  };

  return (
    <div>
      <h1>Inscription Agriculteur</h1>
      <form onSubmit={handleSubmit}>
        {/* Champs pour les informations de l'utilisateur */}
        <label>
          Nom d'utilisateur:
          <input type="text" value={username} onChange={e => setUsername(e.target.value)} />
        </label>
        <label>
          Mot de passe:
          <input type="password" value={password} onChange={e => setPassword(e.target.value)} />
        </label>
        <label>
          Email:
          <input type="email" value={email} onChange={e => setEmail(e.target.value)} />
        </label>

        {/* Champs pour les informations de l'agriculteur */}
        <label>
          Nom de la ferme:
          <input type="text" value={name} onChange={e => setName(e.target.value)} />
        </label>
        <label>
          Description:
          <textarea value={description} onChange={e => setDescription(e.target.value)} />
        </label>
        <label>
          Adresse:
          <input type="text" value={address} onChange={e => setAddress(e.target.value)} />
        </label>
        <label>
          Ville:
          <input type="text" value={city} onChange={e => setCity(e.target.value)} />
        </label>
        <label>
          Code Postal:
          <input type="text" value={zipCode} onChange={e => setZipCode(e.target.value)} />
        </label>
        <label>
          Latitude:
          <input type="text" value={latitude} onChange={e => setLatitude(e.target.value)} />
        </label>
        <label>
          Longitude:
          <input type="text" value={longitude} onChange={e => setLongitude(e.target.value)} />
        </label>
        <label>
          Téléphone:
          <input type="text" value={phone} onChange={e => setPhone(e.target.value)} />
        </label>
        <label>
          Site Web:
          <input type="text" value={website} onChange={e => setWebsite(e.target.value)} />
        </label>

        <button type="submit">S'inscrire comme agriculteur</button>
      </form>
    </div>
  );
}

export default RegisterFarmerForm;
